var getDebut = function(string){
	var isDebut = false;
	
	var low = string.includes('debut') //true
	var high = string.includes('Debut') //true
	if(low || high){
		isDebut = true;
	}
	//console.log(isDebut)
	return isDebut
}

var getAlbum = function(songname){
	var album;
	switch( songname ) {
    case 'Venusian 2': case 'Self-Immolate': case 'Planet B': case 'Mars for the Rich': case "Perihelion": case "Organ Farmer": case "Hell": case "Superbug": case "Venusian 1":
      album = "Infest the Rats' Nest";
      break;
    case 'Plastic Boogie': case 'The Cruel Millennial': case 'This Thing': case "Cyboogie": case "The Bird Song": case "Boogieman Sam": case "Acarine": case "Real's Not Real":
      album = "Fishing for Fishies";
      break;
    case "I'm in Your Mind": case "I'm Not in Your Mind": case "Cellophane": case "I'm in Your Mind Fuzz": case "Hot Water": case "Am I in Heaven?":
      album = "I'm in Your Mind Fuzz";
      break;
    case "Crumbling Castle": case "The Fourth Colour": case "Deserted Dunes Welcome Weary Feet": case "The Castle in the Air": case "Loyalty": case "Horology": case "Inner Cell":
      album = "Polygondwanaland";
      break;
    case "The Lord of Lightning": case "Digital Black": case "Vomit Coffin": case "The Balrog": case "Han-Tyumi the Confused Cyborg": case "Murder of the Universe": case "Alter Me III": case "Altered Beast IV": case "Alter Me II": case "Altered Beast III": case "Alter Me I": case "Altered Beast II": case "Altered Beast I":
      album = "Murder of the Universe";
      break;
    case "Wah Wah": case "Road Train": case "Gamma Knife": case "People-Vultures": case "Robot Stop": case "Big Fig Wasp": case "Evil Death Roll": case "Mr. Beat":
      album = "Nonagon Infinity";
      break;
    case "Muddy Water": case "The Great Chain of Being": case "All Is Known": case "Beginner's Luck": case "Down the Sink": case "The Wheel": case "Tezeta":
      album = "Gumboot Soup";
      break;
    case "Cut Throat Boogie":
      album = "12 Bar Bruise";
      break;

    case "The Bitter Boogie": case "Dirt": case "Sense":
      album = "Paper Mch Dream Balloon";
      break;

    case "Billabong Valley": case "Rattlesnake": case "Sleep Drifter": case "Doom City": case "Nuclear Fusion": case "Anoxia": case "Open Water": case "Melting":
	  album = "Flying Microtonal Banana";
      break;   

    case "Head On/Pill": case "Let Me Mend the Past": case "Float Along - Fill Your Lungs":
	  album = "Float Along  Fill Your Lungs";
      break;    

    case "Stressin'": case "Work This Time":
	  album = "Oddments";
      break;    


    case "The River": 
      album = "Quarters!";
      break; 

    case "Tour intro": case "Rockafeller Skank": case "":
      album = "Other";
      break; 

    default:
      album = "Cover";
  } 
  return album;
}

var formatWithoutCommas = function(string){
	var newString = string.split(",").join(";")
	return newString;
}

var cleanSetlistData = function(data){
	
	for (var i = 0; i < data.setlist.length; i++) {
	
	if(data.setlist[i].sets.set.length !== 0){
		var show = data.setlist[i].sets.set;
		
		// show info
		//console.log(data.setlist[i])
		var el = data.setlist[i]
		var date = el.eventDate
		var venueInfo = {
			city: el.venue.city.name,
			country: el.venue.city.country.name,
			state: el.venue.city.state,
			stateCode: el.venue.city.stateCode,
			venueLon: el.venue.city.coords.long,
			venueLat: el.venue.city.coords.lat,
			venueName: el.venue.name,
		}
		//allCoords.push(turf.point([venueInfo.venueLon,venueInfo.venueLat]))
		//var setlistLength = null;
		
		
		var setlist = [];
		// song info

		// can be multiple sets for one show
		var thisSetlist = [];
		var setlistSongNames = []
		for (var j = 0; j < show.length; j++) {
			
			var setlist = show[j].song;
			for (var k = 0; k < setlist.length; k++) {

				var song = setlist[k];
				var album = getAlbum(song.name);
				var isDebut = false;
				if(song.info !== undefined){
					isDebut = getDebut(song.info);
				}
				songInfoFormatted = song.info
				//console.log(songInfoFormatted);
				if(songInfoFormatted !== undefined){
					songInfoFormatted = formatWithoutCommas(songInfoFormatted);
				}
				// var songArray = [date,venueInfo.city, venueInfo.country, venueInfo.state, venueInfo.stateCode, venueInfo.venueLon, venueInfo.venueLat, venueInfo.venueName,k + 1,song.name,album,isDebut,songInfoFormatted]
				// CHANGE
				// allSongs.push(songArray);

				// allSongsUnique.push(song.name);
				var songInfo = {
					"track": song.name,
					"album": album,
					"debut": isDebut
				}

				thisSetlist.push(songInfo)
				setlistSongNames.push(song.name)
				var songKey = show[j].song[k]
				songKey.track = song.name;
				songKey.album = album;
				songKey.debut = isDebut;
				songKey.venueCity = venueInfo.city
				songKey.venueName = venueInfo.venueName

				//allSongs.push(song.name);
				//console.log(album);
			}

		}
		
		
	}
	var showInfo = {
			"date": el.eventDate, // string
			"venueInfo": venueInfo, // object
			"setlist": thisSetlist // object  song name, album, debut Y/N
		}

	data.setlist[i].venue.coords = turf.point([venueInfo.venueLon,venueInfo.venueLat]);
	data.setlist[i].showInfo = showInfo
	data.setlist[i].setlistSongNames= setlistSongNames
	//console.log(showInfo);
	//allShows.push(showInfo);
	//console.log(data.setlist[i].sets.set.length)
}
console.log(data);
d3somethingV2(data.setlist);

};



